import React from 'react';
import maleLeagueImg from '../../images/male.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowRight } from '@fortawesome/free-solid-svg-icons';
import './LeagueDetails.css';
const LeagueDetails = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-6">
                    <div className="p-4 text-white leagueInfo">
                        <h2 className="font-weight-bold">Premier League</h2>
                        <p>
                            <FontAwesomeIcon icon={faArrowRight} className="ml-2"></FontAwesomeIcon>
                            Founded: February 20, 1982
                            </p>
                        <p>Country: England</p>
                        <p>Sports Type: Football</p>
                        <p>Gender: Male</p>
                    </div>
                </div>
                <div className="col-md-6">
                    <div className="p-4">
                        <img src={maleLeagueImg} className="img-fluid" alt=""/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LeagueDetails;
